            <p>Bus Type: {bus.busTypeName}</p>
            <p>Start Time: {bus.startTime}</p>
            <p>Arrival Time: {bus.arriveTime}</p>
            <p>Travel Time: {bus.travelTime}</p>
            <p>Seats Available: {bus.availableSeats}</p>
            <p>Fare: â‚¹{bus.fare}</p>
            <p>Service Name: {bus.serviceName}</p>
            <p>Service Number: {bus.serviceNumber}</p>
        </div>
    );
};

export default BusCard;
